import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for products to load
    await page.waitForSelector('.product-card', { timeout: 10000 });

    // Get first product details before adding to cart
    const productTitle = await page.$eval('.product-card .product-title', el => el.textContent.trim());
    const productPrice = await page.$eval('.product-card .product-price', el => {
      // Extract just the main price (ignore original price if present)
      return el.childNodes[0].textContent.trim();
    });

    // Click the first "Add to Cart" button
    const addToCartButton = await page.$('.product-card .add-to-cart');
    await addToCartButton.click();

    // Wait for cart to update (check if cart count changes)
    await page.waitForFunction(() => {
      const cart = document.querySelector('.cart');
      return cart && !cart.textContent.includes('0');
    }, { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_to_cart.png'));

    // Verify cart count updated
    const cartCount = await page.$eval('.cart', el => {
      const match = el.textContent.match(/\d+/);
      return match ? parseInt(match[0]) : 0;
    });

    return {
      success: true,
      action: "Added first product to cart",
      extractedData: {
        productTitle,
        productPrice,
        cartCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
